Using the latitude and longitude of the game's stadium and each team's respective home stadiums I calculate the distance traveled for each team and any effects of elevation. For the purposes of this study I will not adjust capacity differences as that can reasonably be part of the home field effect. I do show the correlation between my estimates and attendance later on.


::: {.cell}

:::


The estimated average home field advantage for all teams from 2005 to 2023 is 0.11 points per drive for the home team. With an average of 12.5 offensive drives for each team we can estimate the average home field advantage is 2.8 points per game.

While I make estimates for average team ability since 2005 in each season of the dataset and each venue they played at in that timespan, I am only assessing the most recent stadium a team has played in for the following analysis if a team has had more than one home stadium since 2005.

Even with 18 years of data, it is difficult to detect if a team has a stronger home field advantage than another. That being said, 2 of them show evidence of being a weaker home field advantage than the average college stadium and 9 show significant evidence of having a stronger home field advantage than other stadiums.

There are a total of 247 current unique home stadiums between FBS and FCS that I have in my dataset. If I am assessing 247 teams home stadiums in my dataset to see if they have a stronger or weaker home field advantage than the average college football team, if there is no effect I would expect 20 percent of the teams to have a posterior probability greater than 0.80 of being different than the average home field advantage (HFA). That would be about 49 teams. In fact my analysis shows that only 11 teams meet such a threshold. Thus, even the teams we do observe with a home field advantage are likely due to chance.

Despite the inconclusive effects for HFA for most teams, I am able to at least provide *an estimate* for each team's home stadium, even if the evidence isn't that strong. This estimate shows the estimated HFA as points *per drive* for each home team above that of an average home field advantage.


